001f6d05-b572-4c21-be6e-95d897592d0f.debug:
{
  "query": "
query FocusProjectCandidateSearch($searchString: String!, $first: Int!, $after:String) {
    rateLimit{
        cost
        limit
        nodeCount
        remaining
        resetAt
        used
    }
    search(type:REPOSITORY, query:$searchString, first:$first, after:$after){
        pageInfo {
            startCursor
            hasNextPage
            endCursor
        }
        repositoryCount
        nodes{
            ...RepositorySummary
        }
    }
}
fragment RepositorySummary on Repository{
    nameWithOwner
    isInOrganization
    owner{
        login
    }
    forkCount
    stargazerCount
    pullRequests{
        totalCount
    }
    issues{
        totalCount
    }
    mentionableUsers{
        totalCount
    }
    watchers{
        totalCount
    }
    discussions{
        totalCount
    }    
    createdAt
    isPrivate
    pushedAt
    visibility
    primaryLanguage{
        name
    }
    languages(first:100){
        edges{
            size
            node{
              name
            }
        }
    }
}
",
  "variables": {
    "searchString": "is:public template:false archived:false stars:>=50 forks:>=50 size:>=1000 pushed:>=2024-01-21 created:2021-04-27..2021-05-01",
